import { useState, useEffect, Button } from "react";
import { Table, Modal } from "antd";
import DetailBill from "./DetailBill";

const ReviewModal = () => {
  const [isModalVisible, setIsModalVisible] = useState(false);

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };

  return (
    <>

      <Modal
        title="Đánh giá"
        visible={isModalVisible}
        onOk={handleOk}
        onCancel={handleCancel}
      >
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Modal>
    </>
  );
};

const Bill = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    setProducts([{ a: "a" }]);
  }, []);

  const columns = [
    {
      title: "Mã hóa đơn",
      dataIndex: "MaHD",
      key: "MaHD",
    },
    {
      title: "Ngày mua",
      dataIndex: "NgayLap",
      key: "NgayLap",
    },
    {
      title: "Tổng tiền",
      dataIndex: "ThanhTien",
      key: "ThanhTien",
    },
    {
      title: "Trạng thái đơn hàng",
      key: "TrangThai",
      dataIndex: "TrangThai",
    },
  ];

  const data = [];

  return (
    <div>
      <Table columns={columns} dataSource={data} />
    </div>
  );
};

export default Bill;
